import React from 'react';
import { Button, DatePicker, Space } from 'antd';
import 'antd/dist/antd.css';
import './index.css';
const { createRoot } = ReactDOM;
const {  Divider, Typography  } = antd;

function App() {
  return (
    <div className='App'>
      <Space>
        <DatePicker />
        <Button type="primary">Primary Button</Button>
      </Space>
    </div>
  );
}

export default App;
